std::string formatString(std::string s)
{
	int num = 5;
	char sep = ' ';
	for(auto it = s.begin(); (num+1) <= std::distance(it, s.end()); it++)
	{
		std::advance(it, num);
		it = s.insert(it, sep);
	}
	return s;
}

